import React, { Component } from 'react'
import EachComment from './EachComment'

const Comments = ({comments}) => {
  return(
    <div>
      <div className="loaded-comments">
        {comments && comments.map((comment) => {
          return(
            <div key={comment.id}>
              <EachComment comment={comment}/>
            </div>
          )
        })}
      </div>
    </div>
  )
}

export default Comments
